import React from 'react';
import { Link } from 'react-router-dom'

function NavLink(props) {
  return (
    <div to={props.route}>
        <label>
            <input type='radio' name='navLinkRadio' defaultChecked/>
            <span>
                <div>
                    <i className={props.icon}></i>
                </div>
                <div>{props.description}</div>
            </span>
        </label>
    </div>
  );
}

export default NavLink;
